window.bookSummaryJSON = "<p>Lethal Dark Fae Assassin Hawke is a bloody liar...</p> <p>I didn't run away from him.</p> <p>I would've never run away from his massive arms, his beautiful, sculpted chest, that delicious heat of his brooding, grouchy presence. *swoon*</p> <p>I escaped to get his attention.</p> <p>To prove that can't control me, stalk me, yet pretend that the chemistry between us doesn't exist.</p> <p>I broke away in a show of independence...only Hawke came after me.</p> <p>No, correction: He freakin' kidnapped me because he claims that \"he knows best\". The hell?</p> <p>He insists that it's the only way to keep me safe from the vampire-Viking alliance.</p> <p>That he'll do anything to protect me. Even keep me hidden away from the world, and out of his heart and his bed, because, you know, he's too old for me? As if!</p> <p>Except...he's here with me.</p> <p>In this tiny house, it's just me and him, and his mouth-watering masculine scent that clings to my skin, *gulp* Oh, and he's still in denial? What the -?</p> <p>What's a girl got to do when surrounded by a 100 percent virile, growly, a-phahole? (especially when he makes my panties melt with a glare?) *shiver*</p> <p>I set out to tempt him, show him what he's missing...then, he reveals his secret.</p> <p>Turns out, once you catch the attention of the devil, there is no going back...</p> <p>**Paranormal dark fae age gap romance with a HEA. Featuring a dangerous dark fae male and a sassy woman he'll protect with his life.</p>"; 
